            $URi = new \Purl\Url($url);
            $arr = $URi->query->getData();
            $person['siteId'] = trim($arr['id']);
            $person['belongPlace'] = trim($tr->find('td')->eq(2)->text());
            $person['compName'] = trim($tr->find('td')->eq(3)->text());
            $person['certNumber'] = trim($tr->find('td')->eq(4)->text());
            $document = $collection->findOne(['certNumber' => $person['certNumber']]);
            if (!empty($document)) {
                echo "exist! " . $person['certNumber'] . "\n";
                continue;
            }
            $person['endTime'] = strtotime(trim($tr->find('td')->eq(6)->text()));
//            $certLevel = $this->explainCert(trim($tr->find('td')->eq(7)->text()));
//            $person['certName'] = $certLevel['name'];
